nter;"><span style="font-family: &#39;Lato&#39;;"><strong>Rosso = Pula</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q" style="text-align: center;"><span style="font-family: &#39;Lato&#39;;"><strong>PHILIPPINES: USBONG CONTINUES TO PROVIDE</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q" style="text-align: center;"><span style="font-family: &#39;Lato&#39;;"><strong>COMPUTER SERVICE ASSISTANCE</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q" style="text-align: center;"><span style="font-family: &#39;Lato&#39;;"><strong>BY SHARING KNOW-HOW ON MAPARAANG PAGBIBILANG</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q" style="text-align: right;"><span style="font-family: &#39;Lato&#39;;"><strong>May  2021</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>To eliminate excess steps and inefficient time usage, Marikina Orthopedic Specialty Clinic (MOSC) requested Usbong&#39;s services to automate routine, monotonous tasks and share with unit members know-how on computers.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>1) Continued to update </strong></span><span class=" aw5Odc" style="font-family: &#39;Lato&#39;; text-decoration: underline;"><a class="XqQF9c" href="https://www.google.com/url?q=https%3A%2F%2Fgithub.com%2Fusbong%2FKMS&amp;sa=D&amp;sntz=1&amp;usg=AFQjCNGjt1ZKZbnciwvwNlBdHyMahy8h2g" target="_blank"><strong>Knowledge Management System (KMS)</strong></a></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; 1.1) verified: instructions to upload Index Cards as Image Files</strong></span></p></div></div></div></div></div></div></div></div></div></section><section id="h.305c47797de324fe_1955" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-OiUrBf purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_1958" class="hJDwNd-AhqUyc-OiUrBf jXK9ad D2fZ2 OjCsFc wHaque"><div class="jXK9ad-SmKAyb"><div class="tyJCtd baZpAe"><div class="t3iYD"><img src="https://lh5.googleusercontent.com/sxnGHTDhjf5APARw--3tdMK3UYMneOntMs1onqC1dxrKovf3fO7X5JcUuJWxMi1NOs48V7BGV_xrT512tCrp-T9d2_z6Fe6-CpD1TPJUQNV9tVoA=w1280" class="CENy8b" role="img" style="width: 100%; margin: -0.0000011721% 0 -0.0000011721% 0%"></div></div></div></div></div></div></div></div><div class="hJDwNd-AhqUyc-II5mzb JNdkSc L6cTce-purZT L6cTce-pSzOP"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"></div></div></div></div></div></section><section id="h.305c47797de324fe_1959" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-uQSCkd purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_1962" class="hJDwNd-AhqUyc-uQSCkd jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>NOTE (from SYSON, MICHAEL B.):</strong></span></p></div></div></div></div></div></div></div></div></div></section><section id="h.305c47797de324fe_1963" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-R6PoUb purZT-AhqUyc-R6PoUb pSzOP-AhqUyc-R6PoUb JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_1966" class="hJDwNd-AhqUyc-R6PoUb purZT-AhqUyc-R6PoUb pSzOP-AhqUyc-R6PoUb jXK9ad D2fZ2 OjCsFc wHaque"><div class="jXK9ad-SmKAyb"><div class="tyJCtd baZpAe"><div class="t3iYD"><img src="https://lh5.googleusercontent.com/qfWXO61XYx9a29yIAPAAkFC08mLv2Vj8O_YWV5dklvcleTWlihXHIXKjp6Pe3Yj4wRWgzw=w1280" class="CENy8b" role="img" style="width: 100%; margin: 0% 0 0% 0%"></div></div></div></div></div></div></div></div><div class="hJDwNd-AhqUyc-OwsYgb purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_1969" class="hJDwNd-AhqUyc-OwsYgb jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>We have been using the KMS&#39;s Store Image Command to quickly transfer images from a computer, e.g. mobile telephone, to another.</strong></span></p></div></div></div></div></div></div></div><div class="hJDwNd-AhqUyc-II5mzb JNdkSc L6cTce-purZT L6cTce-pSzOP"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"></div></div></div></div></div></section><section id="h.305c47797de324fe_1970" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-II5mzb purZT-AhqUyc-II5mzb pSzOP-AhqUyc-II5mzb JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_1973" class="hJDwNd-AhqUyc-II5mzb pSzOP-AhqUyc-II5mzb jXK9ad D2fZ2 OjCsFc wHaque"><div class="jXK9ad-SmKAyb"><div class="tyJCtd baZpAe"><div class="t3iYD"><img src="https://lh5.googleusercontent.com/HChU1TdkwQ9XGAenHdhTqtCXTbOW-6Mba3ELyM4iFPssF1zzQpZXXkEOIMjdkSudGpMOBUej7Nurf-ZvsE2VoboIWf4uqehgXWQJFXV_uTkK_M2U=w1280" class="CENy8b" role="img" style="width: 100%; margin: -0.0000007711% 0 -0.0000007711% 0%"></div></div></div></div></div></div></div></div><div class="hJDwNd-AhqUyc-OiUrBf JNdkSc L6cTce-purZT L6cTce-pSzOP"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"></div></div></div></div></div></section><section id="h.305c47797de324fe_1974" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-OwsYgb purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_1977" class="hJDwNd-AhqUyc-OwsYgb jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>In addition, the Computer Server automatically stores the image file&#39;s storage LOCATION in the MySQL (Structured Query Language) Database (DB). We note that we do not store the image file in the DB to eliminate excess file storage space consumption..</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>To execute these actions, we use among others:</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span class=" aw5Odc" style="font-family: &#39;Lato&#39;; text-decoration: underline;"><a class="XqQF9c" href="https://www.google.com/url?q=https%3A%2F%2Fwww.apachefriends.org%2F&amp;sa=D&amp;sntz=1&amp;usg=AFQjCNHybwXX6mz9vZC0pRjWVHVaTEENDA" target="_blank"><strong>Apache Web Server</strong></a></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span class=" aw5Odc" style="font-family: &#39;Lato&#39;; text-decoration: underline;"><a class="XqQF9c" href="https://www.google.com/url?q=https%3A%2F%2Fwww.w3schools.com%2Fhtml%2F&amp;sa=D&amp;sntz=1&amp;usg=AFQjCNGnjiqRj1FaUh4bNqOzabPBA-QiXQ" target="_blank"><strong>Hypertext Markup Language (HTML)</strong></a></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span class=" aw5Odc" style="font-family: &#39;Lato&#39;; text-decoration: underline;"><a class="XqQF9c" href="https://www.google.com/url?q=https%3A%2F%2Fwww.php.net%2F&amp;sa=D&amp;sntz=1&amp;usg=AFQjCNGUlCk-q5esuXzE4tZTKxa4TS4I_g" target="_blank"><strong>PHP Hypertext Preprocessor (PHP)</strong></a></span><span style="font-family: &#39;Lato&#39;;"><strong> + </strong></span><span class=" aw5Odc" style="font-family: &#39;Lato&#39;; text-decoration: underline;"><a class="XqQF9c" href="https://www.google.com/url?q=https%3A%2F%2Fcodeigniter.com%2Fdownload&amp;sa=D&amp;sntz=1&amp;usg=AFQjCNFQVjzlvsiCvtOXkL4xQVillojK9w" target="_blank"><strong>CodeIgniter Framework (version 2)</strong></a></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span class=" aw5Odc" style="font-family: &#39;Lato&#39;; text-decoration: underline;"><a class="XqQF9c" href="https://www.google.com/url?q=https%3A%2F%2Fwww.mysql.com%2F&amp;sa=D&amp;sntz=1&amp;usg=AFQjCNEvGGObign2adN3GfBzkBlqdJr9cg" target="_blank"><strong>MySQL: Structured Query Language</strong></a></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>Reminder: For select devices, computers do not quickly identify them after connecting via Universal Series Bus (USB) cable.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>Example: Samsung Duos Mobile Telephone requires installation of &quot;Samsung Kies&quot; for a Microsoft Windows Computer to identify it.</strong></span></p></div></div></div></div></div></div></div><div class="hJDwNd-AhqUyc-wNfPc JNdkSc L6cTce-purZT L6cTce-pSzOP"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"></div></div></div></div></div></section><section id="h.305c47797de324fe_1978" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-uQSCkd purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_1981" class="hJDwNd-AhqUyc-uQSCkd jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; 1.2) updated: set of instructions to prevent multiple button clicks, e.g. to execute the add transaction</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Previously, the Computer Server already prevented multiple additions of patients in the same Cart List.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; However, a Unit member can quickly press/click the add patient button multiple times to cause the Server to accept the additions.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; This is due to the time it takes for the Server to verify if a patient already exists in the List.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; learned: we need to add instructions for the Computer Client to automatically set the button to disabled</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; When the Client auto-reloads the page, the button is reset to enabled.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Reminder: We use Javascript to execute Client Commands.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; HTML container values set using PHP Commands are only updated after the Server finishes execution.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; 1.3) continued: to share know-how on computers and Information Technology (IT) tools</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Examples:</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; 1.3.1) answers to questions @</strong></span><span class=" aw5Odc" style="font-family: &#39;Lato&#39;; text-decoration: underline;"><a class="XqQF9c" href="http://www.google.com/url?q=http%3A%2F%2Fwww.stackoverflow.com&amp;sa=D&amp;sntz=1&amp;usg=AFQjCNHxis3Moxumf61TOKR4A6-hB0lXqQ" target="_blank"><strong>www.stackoverflow.com</strong></a></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; 1.3.2) IT ASIA: Information, Technology, and Society in Asia</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Recommended Actions:</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; 1.3.2.1) learn: nihongo, albeit select courses are in the English language</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; 1.3.2.2) verify: map to include countries classified to be part of Asia</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Maparaang Pagbibilang via Information Technology is vital to make Society in Asia strong</strong></span></p></div></div></div></div></div></div></div></div></div></section><section id="h.305c47797de324fe_1982" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-OwsYgb purZT-AhqUyc-II5mzb p