may 500 sundalo ang kanilang kalaban, magdala na sila ng 600 sundalo.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Kung may kakayanang magpadala ng Airstrike ang kanilang kalaban, maiging magsama sila ng mga Anti-aircraft vehicle.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q">-<span style="font-family: &#39;Lato&#39;;"><strong>-&gt; 1.4) continued: to provide computer service assistance via computer parts repair and replacement</strong></span></p></div></div></div></div></div></div></div></div></div></section><section id="h.305c47797de324fe_1990" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-qWD73c purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_1993" class="hJDwNd-AhqUyc-qWD73c jXK9ad D2fZ2 OjCsFc wHaque"><div class="jXK9ad-SmKAyb"><div class="tyJCtd baZpAe"><div class="t3iYD"><img src="https://lh5.googleusercontent.com/I4-mPWEW-nAOTK4kAlcQyoI6majYtBFy4cyZtKLRD4LEn0FRzs9RBfiPk4YxocRCYjUM8pV3ClS_noXZlHI2EjbDYFY5AzkKSwD5fAdcbvbfQEa4=w1280" class="CENy8b" role="img" style="width: 100%; margin: -0.0000011176% 0 -0.0000011176% 0%"></div></div></div></div></div></div></div></div><div class="hJDwNd-AhqUyc-qWD73c JNdkSc L6cTce-purZT L6cTce-pSzOP"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"></div></div></div></div></div></section><section id="h.305c47797de324fe_1994" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-uQSCkd purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_1997" class="hJDwNd-AhqUyc-uQSCkd jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; reminded: Unit members to clean area due to insects, e.g. ipis/cockroaches, enter the computer box to cause problems, e.g. hardware reading failure</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Ipis size can be 4cm; Ipis egg size 2cm</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; In addition, loose SATA cable connection can cause hardware reading failure.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; where: SATA = Serial Advanced Technology Attachment</strong></span></p></div></div></div></div></div></div></div></div></div></section><section id="h.305c47797de324fe_1998" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-qWD73c purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2001" class="hJDwNd-AhqUyc-qWD73c jXK9ad D2fZ2 OjCsFc wHaque"><div class="jXK9ad-SmKAyb"><div class="tyJCtd baZpAe"><div class="t3iYD"><img src="https://lh4.googleusercontent.com/_V5yOYXiTx3ld1uo5wClBQjw4vFwLMrLF_X8PpoWmSVdiHwmypnKMFuiPmvHSeVXpHZFmrhlbsNXzVamCkXWXxeaA9nGRm7O25hMbVd4nf_UDkzv=w1280" class="CENy8b" role="img" style="width: 100%; margin: -0.0000012224% 0 -0.0000012224% 0%"></div></div></div></div></div></div></div></div><div class="hJDwNd-AhqUyc-qWD73c JNdkSc L6cTce-purZT L6cTce-pSzOP"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"></div></div></div></div></div></section><section id="h.305c47797de324fe_2002" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-uQSCkd purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2005" class="hJDwNd-AhqUyc-uQSCkd jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>NOTE (from SYSON, MICHAEL B.):</strong></span></p></div></div></div></div></div></div></div></div></div></section><section id="h.305c47797de324fe_2006" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-R6PoUb purZT-AhqUyc-R6PoUb pSzOP-AhqUyc-R6PoUb JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2009" class="hJDwNd-AhqUyc-R6PoUb purZT-AhqUyc-R6PoUb pSzOP-AhqUyc-R6PoUb jXK9ad D2fZ2 OjCsFc wHaque"><div class="jXK9ad-SmKAyb"><div class="tyJCtd baZpAe"><div class="t3iYD"><img src="https://lh3.googleusercontent.com/BR5sk-8ZsT7vtO1H1TEvlklgPZ1dBvTpWWXE9GTPQHGh8TeTe8qePgW_5XMSvvPOBREuvg=w1280" class="CENy8b" role="img" style="width: 100%; margin: 0% 0 0% 0%"></div></div></div></div></div></div></div></div><div class="hJDwNd-AhqUyc-OwsYgb purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2012" class="hJDwNd-AhqUyc-OwsYgb jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>The budol-budol/carnapper/manloloko/cybercriminal/Communist Terrorist group continues to misuse wireless broadcasting technology to cause noise and physical injury.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>Effect: While executing computer repair, such noise can cause among others: physical movement problems, e.g. excess movement to make hands drop and hit objects, e.g. computer fan.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>Reminder: The computer fan&#39;s blades are sufficiently sharp, especially when spinning, to cut finger skin and cause blood to come out.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>I experienced this result after again being targeted by this Teroristang Komunista group. In my more than 10 years of working with computers, this was the first incident of my finger hitting the computer fan.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>Reminder: We unplug the electrical socket from the outlet consent to eliminate physical injury.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>The noise from the Teroristing Komunista can also cause problems in memory, e.g. remembering.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>Reminder: wireless broadcasting technology is used as weapon to cause dizziness, et cetera, equal with the effects of illegal drugs, e.g. taima, marijuana</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>Modus Operandi: Target person is caused to leave object, e.g. cash, mobile telephone, on a table. Teroristang Komunista picks the object to be classified as stolen.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>Cause: Quick money; especially because stolen money by Teroristang Komunista group has become insufficient due to their increasing members who marry and have children.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>Executed Action among others:</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>1) Filed written incident report to provide assistance to Law Enforcement</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>Recommended Action: Puksain ang mga Teroristang Komunista</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>Additional Note:</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>1) Software/computers/machines do not intentionally cause us physical injuries. The problem is with people classified to be Teroristang Komunista who intentionally misuse technology by causing us physical injuries to quickly get money.</strong></span></p></div></div></div></div></div></div></div><div class="hJDwNd-AhqUyc-II5mzb JNdkSc L6cTce-purZT L6cTce-pSzOP"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"></div></div></div></div></div></section><section id="h.305c47797de324fe_2013" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-uQSCkd purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2016" class="hJDwNd-AhqUyc-uQSCkd jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; 1.5) updated: set of instructions to auto-generate Monthly Summary Report of Daily Patient Count</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; This is in addition to the Monthly Report from partner Sta. Lucia Health Care Center (SLHCC) Unit.</strong></span></p></div></div></div></div></div></div></div></div></div></section><section id="h.305c47797de324fe_2017" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-Clt0zb purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc yYI8W "><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2020" class="hJDwNd-AhqUyc-Clt0zb jXK9ad D2fZ2 OjCsFc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd baZpAe"><div class="t3iYD"><img src="https://lh4.googleusercontent.com/pVHz7Df-6-KSLuQgIVCcdU36p8YrOXi5dt2SV9uBXUH52l6l2LAG1oybrarJRTYel-Br1rACOgPD55u4oTrS_dsBRxK4Q1JxVrTbV2XlD9CYgttn=w1280" class="CENy8b" role="img" style="width: 100.0000030377%; margin: 0% 0 0% -0.0000015188%"></div></div></div></div></div><div class="oKdM2c"><div id="h.305c47797de324fe_2022" class="hJDwNd-AhqUyc-Clt0zb jXK9ad D2fZ2 wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q" style="text-align: center;"><span style="font-family: &#39;Lato&#39;;"><strong>EXAMPLE MOSC REPORT</strong></span></p></div></div></div></div></div></div></div><div class="hJDwNd-AhqUyc-c5RTEf JNdkSc L6cTce-purZT L6cTce-pSzOP"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"></div></div></div></div></div></section><section id="h.305c47797de324fe_2023" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-uQSCkd purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2026" class="hJDwNd-AhqUyc-uQSCkd jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; observed: increase in patient count in the year 2020 and 2021</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; This is due to increase in Medical Doctors in the morning and increase in patients in the afternoon.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; In select months from 2019 to 2020, patient count via data entered in Computer Database stopped.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; This is due to among others:</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Trained Unit member left to work in the Kingdom of Saudi Arabia.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; received: request to focus on partner SLHCC Unit to verify cause of payment delays</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; This is for both Cash and Health Maintenance Organization (HMO) payments.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; learned: after providing assistance and working on the tasks, e.g. those executed by SLHCC&#39;s Accounting Unit, that there exist attacks to Unit members by the budol-budol/car-napper/manloloko/cybercriminal/Communist Terrorist group who misuse wireless broadcasting technology.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; The effect of such attacks is equal with that of illegal drugs for use with the central nerve.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Examples of such illegal drugs: taima, marijuana</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Examples of Effect: excitement, dizziness, illusion</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Reminder: At partner SLHCC Unit, patient count decreased by at least 25%</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; This is due to decrease in Medical Doctors for Consultation and patients opting not to come for Physical Therapy (PT) Treatment.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Example Cause: to eliminate infection from CORONA VIRUS 2019 (COVID-19)</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; 1.6) updated: @partner Sta. Lucia Health Care Center (SLHCC) Unit, </strong></span><span class=" aw5Odc" style="font-family: &#39;Lato&#39;; text-decoration: underline;"><a class="XqQF9c" href="https://www.google.com/url?q=https%3A%2F%2Fgithub.com%2Fusbong%2Ftemplates%2Ftree%2Fmaster%2FSLHCC&amp;sa=D&amp;sntz=1&amp;usg=AFQjCNEc0mi6zcdUxrkcu_uxXiGsySSBDA" target="_blank"><strong>set of instructions</strong></a></span><span style="font-family: &#39;Lato&#39;;"><strong> in workbooks to auto-generate Payslip and Official Receipt Reports</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; This is due to select Medical Doctors from May 2021 use an increased Tax Withheld value, i.e. 10%.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Previously, it was 5%.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; ORTHO &amp; PT Unit Member notifies via Local Unit Telephone the Cashier @Cashier Unit to already auto-generate Payslip Report due to no more Cash payments from patients for the day.</strong></span></p></div></div></div></div></div></div></div></div></div></section><section id="h.305c47797de324fe_2027" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-Clt0zb purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc yYI8W "><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2030" class="hJDwNd-AhqUyc-Clt0zb jXK9ad D2fZ2 OjCsFc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd baZpAe"><div class="t3iYD"><img src="https://lh4.googleusercontent.com/Z38SP14tcEY0S4NcDyONh46K0N6FJ0inQWqkmlc8q3wtfY4-4rxAAlOfxbTUoNdyGJHlnh9rmJnw2mYqhyiiZ-rO0caEAM05lFMrDqneYHIr18ay=w1280" class="CENy8b" role="img" style="width: 100%; margin: -0.0000006637% 0 -0.0000006637% 0%"></div></div></div></div></div><div class="oKdM2c"><div id="h.305c47797de324fe_2032" class="hJDwNd-AhqUyc-Clt0zb jXK9ad D2fZ2 wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q" style="text-align: center;"><span style="font-family: &#39;Lato&#39;;"><strong>EXAMPLE TECHNICAL SCHEMATICS (HARDWARE)</strong></span></p></div></div></div></div></div></div></div><div class="hJDwNd-AhqUyc-c5RTEf JNdkSc L6cTce-purZT L6cTce-pSzOP"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"></div></div></div></div></div></section><section id="h.305c47797de324fe_2033" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-uQSCkd purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2036" class="hJDwNd-AhqUyc-uQSCkd jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Computer Client @Cashier Unit auto-sends the Payslip Report with the transaction details.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; This is received by the Computer Server @ORTHO &amp; PT Unit.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; We use a Mini Router with one (1) small antenna to wirelessly connect the computers in a local network.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Example: Router Machine from </strong></span><span class=" aw5Odc" style="font-family: &#39;Lato&#39;; text-decoration: underline;"><a class="XqQF9c" href="https://www.google.com/url?q=https%3A%2F%2Fwww.linksys.com%2Fph%2F&amp;sa=D&amp;sntz=1&amp;usg=AFQjCNH_ov5sdCjByRwMXC12DwP7q8uDUg" target="_blank"><strong>https://www.linksys.com/ph/</strong></a></span></p></div></div></div></div></div></div></div></div></div></section><section id="h.305c47797de324fe_2037" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-OiUrBf purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2040" class="hJDwNd-AhqUyc-OiUrBf jXK9ad D2fZ2 OjCsFc wHaque"><div class="jXK9ad-SmKAyb"><div class="tyJCtd baZpAe"><div class="t3iYD"><img src="https://lh5.googleusercontent.com/tITNqWM8GkcSoBPMbNJpgSA4cfsPkw-hog_GCQMXeODEAoQnaYw5GDeAxbBRwG9X2JtTtaX9mgsdqC9a2doyJaSxACMZHoMPiaHKqy7H4J1-oiSq=w1280" class="CENy8b" role="img" style="width: 100%; margin: -0.0000003885% 0 -0.0000003885% 0%"></div></div></div></div></div></div></div></div><div class="hJDwNd-AhqUyc-II5mzb JNdkSc L6cTce-purZT L6cTce-pSzOP"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"></div></div></div></div></div></section><section id="h.305c47797de324fe_2041" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-uQSCkd purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2044" class="hJDwNd-AhqUyc-uQSCkd jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; We use additional IT tools to automatically transfer data from the Microsoft EXCEL workbook stored in a Computer Client @Cashier Unit to the Computer Server @ORTHO &amp; PT Unit.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; We add Macros, i.e. set of instructions, that we wrote using the Visual Basic for Applications (VBA) Computer Language to save data as Tab-delimited .txt files in the file system storage of the Microsoft Windows Operating System.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; In addition, our Macros include execution of Batch Command Files.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Reminder: Batch Command Files are identified and executed by Computer Machines that use the Microsoft Windows OS. With Linux, e.g. LUBUNTU 20.04LTS, an alternative to the Microsoft Windows OS, we use Bash Shell Command Files.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; The Batch Command Files contain instructions to notify the Java Virtual Machine (VM) to execute a set of instructions to automatically use as input the Tab-delimited .txt files into a packet that we can send to another Computer that is also connected to the network.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; The .txt files contain the Payslip transaction data from the Microsoft EXCEL workbook.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Example Destination: Computer @ORTHO &amp; PT Unit</strong></span></p></div></div></div></div></div></div></div></div></div></section><section id="h.305c47797de324fe_2045" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-Clt0zb purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc yYI8W "><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2048" class="hJDwNd-AhqUyc-Clt0zb jXK9ad D2fZ2 OjCsFc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd baZpAe"><div class="t3iYD"><img src="https://lh5.googleusercontent.com/JkGfh9OtVIkpiSLQxeiwJzqHJn4hyVXK_J347OwPCN1cy591Z7R1rVHIWndzbt1DtxUvwMD_q30s70BwHCpxah_ax9qbT5MD5OXw0VNsCWmO3bLc=w1280" class="CENy8b" role="img" style="width: 100%; margin: -0.0000000508% 0 -0.0000000508% 0%"></div></div></div></div></div><div class="oKdM2c"><div id="h.305c47797de324fe_2050" class="hJDwNd-AhqUyc-Clt0zb jXK9ad D2fZ2 wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q" style="text-align: center;"><span style="font-family: &#39;Lato&#39;;"><strong>EXAMPLE TECHNICAL SCHEMATICS (SOFTWARE)</strong></span></p></div></div></div></div></div></div></div><div class="hJDwNd-AhqUyc-c5RTEf JNdkSc L6cTce-purZT L6cTce-pSzOP"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"></div></div></div></div></div></section><section id="h.305c47797de324fe_2051" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-uQSCkd purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2054" class="hJDwNd-AhqUyc-uQSCkd jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; The Java Computer Language empowers us to use existing libraries, which contain sets of instructions available to the public, to execute Web Network Commands, e.g. those written in the PHP Computer Language. With this action, we do not anymore need to open a Computer Web Browser, thereby eliminating excess steps and making execution faster.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Additional Note: We can opt to use Computer Web Browsers, instead of executing the tasks using Microsoft EXCEL workbooks. With this action, we shall exchange the use of MS EXCEL workbooks with Web Browsers. At present, however, our partner clinic prefers to use MS EXCEL workbooks.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; The Computer that receives the packet auto-stores its data in its Database (DB) in the Structured Query Language (SQL) and as a Tab-delimited .txt file in a list stored inside a folder in the OS.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; The packet and the stored data in MySQL DB adhere to the JSON format.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; In addition, using the PHP Computer Language, we can add and execute MYSQL Commands to interact with the DB and Batch Command Files to interact with the OS.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Additional Note: We still store data in the DB, not only to use as a history list, but also to prepare when we execute system upgrade, which includes rank up of Unit members&#39; skill level, by using Web Browsers.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Unit Members @ORTHO &amp; PT Unit can now notify the Microsoft Excel Workbook via a Macro to auto-generate the Payslip Report, including auto-computing the expected Amount Paid and Professional Fee.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Reminder: Correct Health Maintenance Organization (HMO) Fees and Cash Discounts, e.g. for Senior Citizens, are auto-computed.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; The Macro opens and reads the day&#39;s packet stored as a Tab-delimited .txt file in a folder in the OS.</strong></span></p></div></div></div></div></div></div></div></div></div></section><section id="