pan style="font-family: &#39;Lato&#39;;"><strong>Workbook File Opened Using LibreOffice Calc</strong></span></p></div></div></div></div></div></div></div><div class="hJDwNd-AhqUyc-c5RTEf JNdkSc L6cTce-purZT L6cTce-pSzOP"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"></div></div></div></div></div></section><section id="h.305c47797de324fe_2063" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-uQSCkd purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2066" class="hJDwNd-AhqUyc-uQSCkd jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; The Macro uses the data to auto-correct the Payslip Report @ORTHO &amp; PT Unit.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; It includes notes, e.g. corrections if select transactions are not equal with that @Cashier Unit.</strong></span></p></div></div></div></div></div></div></div></div></div></section><section id="h.305c47797de324fe_2067" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-Clt0zb purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2070" class="hJDwNd-AhqUyc-Clt0zb jXK9ad D2fZ2 OjCsFc wHaque"><div class="jXK9ad-SmKAyb"><div class="tyJCtd baZpAe"><div class="t3iYD"><img src="https://lh6.googleusercontent.com/QrTjet7e3RbIs3nspCPte0tU8cvjmXPyg--_D37f