yb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2078" class="hJDwNd-AhqUyc-uQSCkd jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; In addition, the computer server includes in the auto-generation a Tab-delimited .txt file with the transactions data for the Month.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; The computer stores this .txt file in a folder.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Data in this file is equal with data in the Month&#39;s worksheet.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; We create and store a .txt file for each month for both Consultation and PT Treatment transactions.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; We use this file with Report Generation, e.g. for Monthly Summary Report, HMO Billing Report.</strong></span></p></div></div></div></div></div></div></div></div></div></section><section id="h.305c47797de324fe_2079" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-uQSCkd purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2082" class="hJDwNd-AhqUyc-uQSCkd jXK9ad D2fZ2 OjCsFc wHaque"><div class="jXK9ad-SmKAyb"><div class="tyJCtd baZpAe"><div class="t3iYD"><img src="https://lh3.googleusercontent.com/qrBxRvnkQCL8isV8UFxzmeYQdWMTXvl_zHG4lKP1jPsnGUvWSRrah20psAGAYYc7cQeSz_mdB9CClOk1u2UXsjUOVFq260BNE24KXomyYgDZPu49=w1280" class="CENy8b" role="img" style="width: 100%; margin: -0.0000000508% 0 -0.0000000508% 0%"></div></div></div></div></div></div></div></div></div></div></section><section id="h.305c47797de324fe_2083" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-uQSCkd purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2086" class="hJDwNd-AhqUyc-uQSCkd jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>2) Continued with Research &amp; Development (R&amp;D)</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Usbong: Reduce, Reuse, Recycle</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; verified: techniques to reuse available machines, e.g. television (TV) sets</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; The objective is to connect them to the Computer Server via LAN (Wireless・Wired)</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; where: LAN = Local Area Network</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Example Usage: View Patient Wait List on the TV set</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; 2.1) verified: adding PlayStation Portable (PSP) to TV set</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; learned: PSP&#39;s Computer Web Browser Technology accepts only select HTML Commands;</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Web Services, e.g. YouTube, do NOT execute</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; Therefore, we shall need to update the Computer Server instructions</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; This is so that files are displayed correctly on the TV set + PSP.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; 2.2) verified: adding Android box to TV set</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; learned: we can add input devices, e.g. computer keyboard &amp; mouse, XBOX360 Controller</strong></span></p></div></div></div></div></div></div></div></div></div></section><section id="h.305c47797de324fe_2087" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-qWD73c purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2090" class="hJDwNd-AhqUyc-qWD73c jXK9ad D2fZ2 OjCsFc wHaque"><div class="jXK9ad-SmKAyb"><div class="tyJCtd baZpAe"><div class="t3iYD"><img src="https://lh5.googleusercontent.com/iki2jGAAbdK8e39epYeUCiQARVpU0uyQ2T-g8Hh70Qnfh1di1AymBsCJt2POY-adqS6RMNfFzSe6wySCa0-I6zwYWD0l6xh34xGmldPp9nZzGVTb=w1280" class="CENy8b" role="img" style="width: 100%; margin: -0.0000011176% 0 -0.0000011176% 0%"></div></div></div></div></div></div></div></div><div class="hJDwNd-AhqUyc-qWD73c JNdkSc L6cTce-purZT L6cTce-pSzOP"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction=