HxWK83e2j3O6xG3aystDluHoYO_-4ZltCTWmec_NmRjivwXnzvrW19G09O8FSD1Pa_wz=w1280" class="CENy8b" role="img" style="width: 100%; margin: -0.0000004424% 0 -0.0000004424% 0%"></div></div></div></div></div></div></div></div><div class="hJDwNd-AhqUyc-OiUrBf JNdkSc L6cTce-purZT L6cTce-pSzOP"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"></div></div></div></div></div></section><section id="h.305c47797de324fe_2134" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-uQSCkd purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2137" class="hJDwNd-AhqUyc-uQSCkd jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; 2.5) Security Defense Force</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; verified: German Luger weapon tool mechanism to be rapid fire</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; reminder: Put tool close to your center position when firing projectiles to quickly and correctly hit targets</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; If you put tool closer to, e.g. your right side, hitting targets becomes difficult, especially when you also move your position.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; There is a known problem with what we see, such that we do not hit targets.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; This is even if it appears that we should have hit the targets.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; With machine-guns, rapid firing with stationary rotating movement to cause oscillating, i.e. wave movement, of projectiles increases hits.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; If you are already hitting the target, no need to add excess wave movement.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>--&gt; This is due to tool mechanism&#39;s precision, i.e. rapid fire causes projectiles to consistently hit set location.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>NOTE (from SYSON, MICHAEL B.):</strong></span></p></div></div></div></div></div></div></div></div></div></section><section id="h.305c47797de324fe_2138" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-R6PoUb purZT-AhqUyc-R6PoUb pSzOP-AhqUyc-R6PoUb JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2141" class="hJDwNd-AhqUyc-R6PoUb purZT-AhqUyc-R6PoUb pSzOP-AhqUyc-R6PoUb jXK9ad D2fZ2 OjCsFc wHaque"><div class="jXK9ad-SmKAyb"><div class="tyJCtd baZpAe"><div class="t3iYD"><img src="https://lh6.googleusercontent.com/jUcXURn35Y0EaajdiWbn_NQvuHOhoUou04D-NjdL_QqgLVBwL3kOUhQaSVzJ-uQ8qO58zA=w1280" class="CENy8b" role="img" style="width: 100%; margin: 0% 0 0% 0%"></div></div></div></div></div></div></div></div><div class="hJDwNd-AhqUyc-OwsYgb purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.305c47797de324fe_2144" class="hJDwNd-AhqUyc-OwsYgb jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>We learn that 三上 真司 (Mikami, Shinji; CAPCOM バイオハザード BIOHAZARD Producer) shares the objective of creating a world system for us to experience being stuck there and approaching death.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>We have the option to choose to execute one of these two (2):</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>1) wait to be killed by the virus, i.e. virus-infected zombie</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>2) fight before we die</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>He adds that such experience is similar to the preference of select people to not drink Lager Beer. It is either we choose to experience it or not.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>Reminders:</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>German Luger weapon tool</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>German Lager Beer</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>Additional Note:</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>1) We classify &quot;Producer&quot; to be &quot;Unit Chief&quot; due to if project fails, , i.e. expenses &gt; income, Producer is accountable to pay financially for the failed project.</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>Reference:</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>三並達也 (Ed). (1997). &quot;BIO HAZARD: The True Story Behind BIO HAZARD&quot;. OSAKA: CAPCOM</strong></span></p><p dir="ltr" class="CDt4Ke zfr3Q"><span style="font-family: &#39;Lato&#39;;"><strong>TO-DO: -update: this</strong></span></p></div></div></div></div></div></div></div><div class="hJDwNd-AhqUyc-II5mzb JNdkSc L6cTce-purZT L6cTce-pSzOP"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"></div></div></div></div></div></section></div><div class="Xpil1b"></div><footer><section id="h.52171df51998fc4f_38" class="yaqOZd" style=""><div class="IFuOkc"></div><div class="mYVXT"><div class="LS81yb VICjCf" tabindex="-1"><div class="hJDwNd-AhqUyc-uQSCkd purZT-AhqUyc-II5mzb pSzOP-AhqUyc-qWD73c JNdkSc"><div class="JNdkSc-SmKAyb"><div class="" jscontroller="sGwD4d" jsaction="zXBUYb:zTPCnb;zQF9Uc:Qxe3nd;" jsname="F57UId"><div class="oKdM2c Kzv0Me"><div id="h.52171df51998fc4f_35" class="hJDwNd-AhqUyc-uQSCkd jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb"><div class="tyJCtd mGzaTb baZpAe"><small id="h.gdn9ehtknxta" dir="ltr" class="CDt4Ke zfr3Q TMjjoe" style="display: block; text-align: center;"><br></small></div></div></div></div></div></div></div></div></div></section></footer><div jscontroller="j1RDQb" jsaction="rcuQ6b:rcuQ6b;MxH79b:JdcaS;FaOgy:XuHpsb;" class="dZA9kd ynRLnc" data-last-updated-at-time="1629538710676"><div role="button" class="U26fgb JRtysb WzwrXb I12f0b K2mXPb zXBiaf ynRLnc" jscontroller="iSvg6e" jsaction="click:cOuCgd; mousedown:UX7yZ; mouseup:lbsD7e; mouseenter:tfO1Yc; mouseleave:JywGue; focus:AHmuwe; blur:O22p3e; contextmenu:mg9Pef;touchstart:p6p2H; touchmove:FwuNnf; touchend:yfqBxc(preventMouseEvents=true|preventDefault=true); touchcancel:JMtRjd;;keydown:I481le;" jsshadow jsname="Bg3gkf" aria-label="Site actions" aria-disabled="false" 